import { Route, Routers } from 'react-router-dom'
import './App.css';
import Navbar from './Components/Navbar/Navbar';

function App() {
  return (
    <>
      <Navbar />
      <Routers>
        <Router path="/" element={<div></div>} />
      </Routers>
    </>
  );
}

export default App;
